import React from "react";
import Table from "./Table";

const Info = ({
  avgPPG,
  avgRPG,
  avgAPG,
  avgTO,
  totPPG,
  totRPG,
  totAPG,
  totTO,
  avgFG,
  avgThree,
  avgFree,
}) => {
  return (
    <div className="info">
      <div className="left">
        <Table a />
      </div>
      <div className="right">
        <h1 className="grade">A+</h1>
      </div>
    </div>
  );
};

export default Info;
